import React from 'react';
import styled from 'styled-components';

function SearchBar() {
	return <ComponentWrapper>SearchBar</ComponentWrapper>;
}

const ComponentWrapper = styled.div`
	left: 0;
	top: 0;
	width: 100%;
	position: absolute;
	background: #fff;
`;
export default SearchBar;
